import React, { useState, useEffect, useRef, createRef, setState } from "react"
import { Button, View, Text, StyleSheet, ImageBackground, Image, FlatList } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import AsyncStorage from '@react-native-async-storage/async-storage'
import Axios from 'axios'



let url = "localhost:3000";

const Item = ({ name, time }) => (
  <View style={styles.item}>
    <Text style={{fontSize:32}}>{name}    {age}</Text>
  </View>
);


function HighScoresScreen() {

  const [data, setData] = useState("");


  const renderItem = ({ item }) => (
    <Item name={item.name} age={item.age} />
  );

  const getData = () => {
    try {
      //alert("start");
      let jsonValue = Axios.get("127.0.0.1:3000/scores");
      //alert(jsonValue);
      let data = null
      if (jsonValue!=null) {
        data = JSON.parse(jsonValue);
        //setData(data);
        alert(data);
        console.log('just set Info, Correct and Answered')
      } else {
        console.log('just read a null value from Storage')
      }
    } catch(e) {
      console.log("error in getData ")
      console.dir(e)
      // error reading value
    }
  }


  useEffect(() => {
    //clearAll();
    getData()
  },[])


  return (


    <View style={styles.container}>
      <FlatList
        data={data}
        renderItem={renderItem}
      />
    </View>
  );
}

export default HighScoresScreen;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center'
  },
  item: {
    backgroundColor: 'grey',
    padding: 20,
    marginVertical: 8,
    marginHorizontal: 16,
  }
});
